import{_ as e,c as n,o as i,V as s}from"./chunks/framework.249fa23d.js";const m=JSON.parse('{"title":"Plugins","description":"","frontmatter":{},"headers":[],"relativePath":"guide/Plugins.md","filePath":"guide/Plugins.md","lastUpdated":1706777200000}'),t={name:"guide/Plugins.md"},a=s('<h1 id="plugins" tabindex="-1">Plugins <a class="header-anchor" href="#plugins" aria-label="Permalink to &quot;Plugins&quot;">â€‹</a></h1><p>The plugins of Mogan can be divided into two types: built-in plugins and community plugins. According to their functions, they can be divided into:</p><ul><li><strong>Image plugins</strong>: These plugins provide format conversions for different image formats, such as the PDF Image plugin.</li><li><strong>Language plugins</strong>: These plugins provide dictionaries and styles for different natural languages, such as the Chinese Language plugin.</li><li><strong>Data format plugins</strong>: These plugins are used to process data format conversions, such as the HTML Data plugin and LaTeX Data plugin.</li><li><strong>Code plugins</strong>: These plugins provide code highlighting definitions and corresponding styles and editor customizations for programming languages, such as the Python Code plugin.</li><li><strong>Session plugins</strong>: These plugins provide integration with external systems and have context, such as the Maxima Session plugin.</li></ul><p>For example, there are two types of PDF plugins: PDF data plugins and PDF image plugins. The PDF data plugin is responsible for converting PDFs with TeXmacs document attachments (extracting attachments) into TeXmacs documents or converting TeXmacs documents (exporting) into PDF documents. The PDF image plugin is responsible for converting PDF vector graphics into PNG format for correct rendering in Mogan.</p>',4),o=[a];function r(g,l,u,c,d,p){return i(),n("div",null,o)}const f=e(t,[["render",r]]);export{m as __pageData,f as default};
